            articleModel = purchaseRepository.GetCustomerPaymentList(mster.LedgerId);
            foreach (var item in articleModel)
            {
                decTotalDue = decTotalDue + item.TotalDue;
                decTotal = decTotal + item.GrandTotal;
            }
        }
        else
        {
            articleModel.Clear();
            mster.CashAmount = 0;
            mster.BankAmount = 0;
            mster.CreditAmount = 0;
        }
        StateHasChanged();
        payment.TotalAmount = Math.Round(decTotal, PublicVariables._inNoOfDecimalPlaces);
        payment.CashAmount = 0;
        payment.BankAmount = 0;
        payment.CreditAmount = 0;
        showPay = true;
    }
